import React, { Component } from 'react';
class ExperienceCard extends Component {
  render() {
    const {
      city,
      about,
      name
    } = this.props; 

    return (
      <div >
          <React.Fragment>
                {city ? (
                  <React.Fragment>
                    <p style={{fontWeight:"bold",color:"blue",textAlign:"right",padding:"0 1rem"}}>{name}</p>
                    <p id="exp-city">{city}</p>
                    <p id="exp-description">{this.props.description}</p>
                  </React.Fragment>
                ) : (
                  <React.Fragment>
                    <p id="exp-about">{about}</p>
                    <p id="exp-description">{this.props.description}</p>
                  </React.Fragment>
                )}
          </React.Fragment>
      </div>
    );
  }
}

export default ExperienceCard;
